import React from "react";

export default function Employees({ employees = [] }) {
  return (
    <div>
      <h2>Employees</h2>
      {employees.length === 0 ? (
        <p>No employees available</p>
      ) : (
        <ul>
          {employees.map((emp, index) => (
            <li key={index}>
              {emp.name} - {emp.role}
            </li>
          ))}
        </ul>
      )}
    </div>
  );
}
